import React from "react";
import "./App.css";

const App = () => {

  return (
    <div className="App">
      <h1>Image Slider</h1>
      <form className="range-field my-5">
        <input id="calculatorSlider" className="no-border" type="range" value="0" min="0" max="30" />
      </form>
      <div className="row">


      <div className="col-md-6 text-center pb-5">

          <h2><span className="badge blue lighten-2 mb-4">You earn</span></h2>
          <h2 className="display-4" style={{color:"#0d47a1"}}><strong id="resellerEarnings">75$</strong></h2>

        </div>



      <div className="col-md-6 text-center pb-5">

          <h2><span className="badge blue lighten-2 mb-4">Client pays</span></h2>
          <h2 className="display-4" style={{color:"#0d47a1"}}><strong id="clientPrice">319$</strong></h2>

        </div>


    </div>
    </div>
  );
}

export default App;
